// HasConnection applies the HasEdge predicate on the "connection" edge.
func HasConnection() predicate.GoogleDriveSync {
	return predicate.GoogleDriveSync(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ConnectionTable, ConnectionColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasConnectionWith applies the HasEdge predicate on the "connection" edge with a given conditions (other predicates).
func HasConnectionWith(preds ...predicate.GoogleDriveConnection) predicate.GoogleDriveSync {
	return predicate.GoogleDriveSync(func(s *sql.Selector) {
		step := newConnectionStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.GoogleDriveSync) predicate.GoogleDriveSync {
	return predicate.GoogleDriveSync(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.GoogleDriveSync) predicate.GoogleDriveSync {
	return predicate.GoogleDriveSync(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.GoogleDriveSync) predicate.GoogleDriveSync {
	return predicate.GoogleDriveSync(sql.NotPredicates(p))
}
